    render() { 
        return ( 
            <div class="offset-md-2 col-6">
                <form onSubmit={this.handleSubmit}>
                <div class="form-group">
                    <label for="username">Email address</label>
                    <input onChange={this.handleChange} value={this.state.account.username} id="username" type="email" class="form-control"/>
                </div>
                <div class="form-group">
                    <label for="password">Password</label>
                    <input value={this.state.account.password} id="password" type="password" class="form-control"/>
                </div>
                <button type="submit" class="btn btn-primary">Login</button>
                </form>
            </div>

         );
    }
}
 
export default LoginForm;
